El poema es un soneto con dos versos adicionales al final, característico del estilo de Francisco de Quevedo, un famoso poeta español del Siglo de Oro. El texto juega con los nombres de lugares y los apellidos de la actriz Josefa Vaca para construir un juego de ingenio y conceptismo típico de Quevedo.
